import './App.css';
import Input from './components/Input'
import Output from './components/Output'
import {BrowserRouter as Router, Routes, Route} from 'react-router-dom'

function App() {

  return (
    <div className="App">
        <h1 className='heading'>Theme Extracting Utility</h1>
        <Router>
          <Routes>
            <Route exact path="/" element={<Input />} />
            <Route exact path="/output" element={<Output data={window.sessionStorage.getItem('data')} />} />
          </Routes>
        </Router>
    </div>
  );
}

export default App;
